    false,nt"url": null,nt"notes": "A census of all known wetland area large
    enough to have any waterbird use was commenced at Patuxent Research Refuge in the
    fall of 1996. This report is a compilation and discussion of results for the year
    commencing the first week in December 1996. The purpose of this effort is to record
    to the maximum extent possible the waterbird use on Patuxent Refuge by location
    and time of year. And to determine the impacts of weather, especially drought and
    ice, beaver impacts, and impoundment management activities.",nt"license_title":
